def solve():
    n, k = map(int, input().split())
    a = list(map(int, input().split()))
    b = list(map(int, input().split()))

    if k == 1:
        if a[0] == b[0]:
            print("Yes")
        else:
            print("No")
        return

    for i in range(n):
        if a[i] == 0:
            for j in range(k):
                if b[j] not in a:
                    a[i] = b[j]
                    break

    if a == sorted(a):
        print("Yes")
    else:
        print("No")

if True:
    solve()
